function main() {
    ! function() {
        "use strict";
        $(window).load(function() {
            $(".preloader").fadeOut(1e3)
        }), $(document).on("click", "a.page-scroll", function(o) {
            var e = $(this);
            $("html, body").stop().animate({
                scrollTop: $(e.attr("href")).offset().top - 50
            }, 1250, "easeInOutExpo"), o.preventDefault()
        }), $("#nav").affix({
            offset: {
                top: $("header").height()
            }
        }), $("body").scrollspy({
            target: "#nav",
            offset: 51
        }), $(".navbar-collapse ul li a").click(function() {
            $(".navbar-toggle:visible").click()
        }), $(".skill-circle").circliful({
            animation: 1,
            animationStep: 5,
            animateInView: !0,
            foregroundColor: "#ddd",
            backgroundColor: "#222",
            foregroundBorderWidth: 5,
            backgroundBorderWidth: 5,
            fontColor: "#fff"
        }), $(".progress-element").each(function() {
            $(this).waypoint(function() {
                var o = $(".progress-bar");
                o.each(function(o) {
                    $(this).css("width", $(this).attr("aria-valuenow") + "%")
                })
            }, {
                triggerOnce: !0,
                offset: "bottom-in-view"
            })
        }), $(window).load(function() {
            var o = $(".portfolio-items");
            o.isotope({
                filter: "*",
                animationOptions: {
                    duration: 750,
                    easing: "linear",
                    queue: !1
                }
            }), $(".cat a").click(function() {
                $(".cat .active").removeClass("active"), $(this).addClass("active");
                var e = $(this).attr("data-filter");
                return o.isotope({
                    filter: e,
                    animationOptions: {
                        duration: 750,
                        easing: "linear",
                        queue: !1
                    }
                }), !1
            })
        }), $(document).ready(function(o) {
            o("span.count").length > 0 && o("span.count").counterUp({
                delay: 10,
                time: 1500
            })
        })
    }()
}
main(), $(function() {
    ! function() {
        "use stnonerict";

        function o() {
            console.log("image has been loaded...")
        }
        jQuery("#gallery").photobox(".photobox_a"), jQuery("#gallery").photobox(".photobox_a:first", {
            thumbs: !1,
            time: 0
        }, o)
    }()
}), $(document).ready(function() {
    function o() {
        verticalOffset = "undefined" != typeof verticalOffset ? verticalOffset : 0, element = $("body"), offset = element.offset(), offsetTop = offset.top, $("html, body").animate({
            scrollTop: offsetTop
        }, 500, "linear")
    }
    $(function() {
        $(document).on("scroll", function() {
            $(window).scrollTop() > 100 ? $(".scroll-top-wrapper").addClass("show") : $(".scroll-top-wrapper").removeClass("show")
        }), $(".scroll-top-wrapper").on("click", o)
    })
});
